INSERT INTO `tickets` VALUES (5,'John Doe','john@example.com','1234567890','I cannot log into my account. The login button is not working and I get an error message saying \"Invalid credentials\". I have been trying for the past 2 days.','Technical Support','Login Problem',NULL,NULL,NULL,'closed','2025-07-10 13:33:41','2025-07-10 15:05:55',NULL,NULL,0),(6,'Jane Smith','jane@example.com','9876543210','Payment processing error on my last transaction. The payment was deducted from my account but the service was not activated. I need this resolved urgently.','Billing Issue','Payment Processing Error',NULL,NULL,NULL,'closed','2025-07-10 13:33:41','2025-07-10 15:05:56',NULL,NULL,0),(7,'Mike Johnson','mike@example.com','5551234567','Unable to access premium features after subscription renewal. The features are still showing as locked even though my payment went through successfully.','Account Access','Premium Features Not Working',NULL,NULL,NULL,'closed','2025-07-10 13:33:41','2025-07-10 13:40:04',NULL,NULL,0),(8,'Sarah Wilson','sarah@example.com','4449876543','Need help with password reset process. The reset link is not working properly and I cannot access my account. This is urgent as I need to access important documents.','Technical Support','Password Reset Issue',NULL,NULL,NULL,'closed','2025-07-10 13:33:41','2025-07-10 13:33:41',NULL,NULL,0),(9,'David Brown','david@example.com','3334567890','The mobile app is crashing every time I try to upload a photo. This happens on both Android and iOS devices. Please help me resolve this issue.','Bug Report','App Crashes on Photo Upload',NULL,NULL,NULL,'closed','2025-07-10 13:33:41','2025-07-10 15:05:58',NULL,NULL,0),(10,'Lisa Garcia','lisa@example.com','2227894561','I would like to request a dark mode feature for the web interface. This would be very helpful for users who work in low-light environments.','Feature Request','Dark Mode Feature Request',NULL,NULL,NULL,'closed','2025-07-10 13:33:41','2025-07-10 15:06:00',NULL,NULL,0),(11,'Robert Chen','robert@example.com','1112345678','The search functionality is not working properly. When I search for specific terms, it returns irrelevant results or no results at all.','Technical Support','Search Function Not Working',NULL,NULL,NULL,'closed','2025-07-10 13:33:41','2025-07-10 15:06:01',NULL,NULL,0),(12,'Emily Davis','emily@example.com','9998765432','I need to cancel my subscription but cannot find the cancellation option in my account settings. Please help me with the cancellation process.','Account Access','Cannot Cancel Subscription',NULL,NULL,NULL,'closed','2025-07-10 13:33:41','2025-07-10 15:06:03',NULL,NULL,0);
